const ActionType = {
    INCREMENT : 'INCREMENT',
    DECREMENT : 'DECREMENT',
    ADD : 'ADD',
    SUBTRACT : 'SUBTRACT',
    RESET :'RESET',
    STORE_RESULT : 'STORE_RESULT',
    DELETE_RESULT : 'DELETE_RESULT',
}



export default ActionType;
